import React from 'react';

const Navigation = ({onRouteChange}) => {
	return (
		<nav>
			<p 
			onClick="onRouteChange"
			className='f3 dim grow pointer no-underline br-pill ph3 pv2 mb2 dib white bg-light-purple'>Sign out</p>
		</nav>
	)
}

export default Navigation;
